import React from "react";

function Navbar() {
    let Links =[
        {name:"ABOUT",link:"/"},
        {name:"PROJECTS",link:"/"},
        {name:"CONTACT",link:"/"},
     ]
  return (
    <div className="pt-5">
      <h1 className="text-xl text-white font-merriweather">Bara Kharseh</h1>
      <ul>
        {
            Links.map((link)=>(
                <li>
                    <a href={link.link}>{link.name}</a>
                </li>
            ))
        }
      </ul>
    </div>
  );
}

export default Navbar;
